import React from 'react'
import './statusCard.css'

const StatusCard = (props) => {
  const {id,setActiveCard,title,priority} = props;
  return (
    <div id='card' draggable onDragStart={()=> setActiveCard(id)} onDragEnd={()=> setActiveCard()}>
        <p>{title}</p>
        <p>{priority}</p>
    </div>
  )
}

export default StatusCard
